webpackJsonp([57],{"./node_modules/json-loader/index.js!./.cache/json/creating-aliases.json":function(e,o){e.exports={data:{site:{siteMetadata:{title:"Jeffry.in",author:"Jeff Wainwright"}},markdownRemark:{id:"/Users/jwainwright/Dropbox/me/git-docs/yowainwright.github.io/src/pages/2016-05-19-creating-aliases-mac.md absPath of file >>> MarkdownRemark",html:'<p>Creating Aliases on a Mac is an easy thing to do &#x26; can save a lot of time. When working in Terminal or another command line app, you may want to set up an alias to make your workflows easier.\n{: .first-paragraph}</p>\n<p>To do this you\'ll want to set up a <code>.bash_profile</code>:</p>\n<ul>\n<li>Run <code>vi ~/.bash_profile</code> in your command line app of choice, or [text editor of choice] ~/.bash_profile</li>\n<li>This will open up your <code>bash profile</code> in <code>vi</code> or your <code>text editor</code> to be edited</li>\n</ul>\n<p>If you\'d like to use a text editor but don\'t have one that opens instead of <code>vi</code> checkout this <a href="//help.github.com/articles/associating-text-editors-with-git/">post</a></p>\n<p>Here\'s a look at part of my <code>.bash_profile</code>:</p>\n<pre><code class="language-bash"># -------\n# mySQL\n# -------\nexport PATH=/usr/local/mysql/bin:$PATH\n\n# -------\n# host setups\n# -------\nalias hosts="sublime /etc/hosts"\nalias vhosts="sublime /etc/apache2/vhosts"\n</code></pre>',frontmatter:{title:"Creating Aliases on a Mac",date:"May 19, 2016"}}},pathContext:{path:"/creating-aliases/"}}}});
